float sdCircle( vec2 p, float r ) {
    return length(p) - r;
}

void mainImage( out vec4 fragColor, in vec2 fragCoord ) {
    vec2 uv = fragCoord / iResolution.xy * 2.0 - 1.0;
    uv.y *= iResolution.x;
    uv.x *= iResolution.y;

    float d = length(uv);

    d = cos(d*8. / iTime)/8.;

    d = smoothstep(.0, .1, d);

    d = fract(d/.5) * iTime;


    fragColor = vec4(d, d, d, 1.);
}
